之前晚餐時間去完全錯過鬆餅的販賣時間（鬆餅供應到17點為止
這次早八拜訪總算成功雪恥🥞
味道無可挑剔畢竟光是一盤就要價¥2000😳
最令人驚艷的是鬆餅上的牛油一點都不油膩反而很清爽
根本就是要讓人忘記這麼大一塊牛油的罪惡感🧈
希望哪天準哥能重現一下這豪華早餐❤️
